import React from "react";
import { Card } from "react-bootstrap";
import "./App.css";

const Conference = ({
  type,
  title,
  place,
  imageURL,
  startDate,
  endDate,
  website,
}) => {
  return (
    <Card className="box">
      <Card.Header style={{backgroundColor:"white", fontWeight:"bold"}}>{title}</Card.Header>
      <Card.Img variant="top" src={imageURL} width="400" height="250" />
      <Card.Body>
        <Card.Text>
          {startDate} - {endDate}
        </Card.Text>
        <Card.Text>{type}</Card.Text>
        <Card.Text>{place}</Card.Text>
        <Card.Link href={website}>Website Link</Card.Link>
      </Card.Body>
    </Card>
  );
};

export default Conference;
